export const AutocompleteText = () => {

    const [inputName, setInputName] = useState("");
    const names = ['david', 'damien', 'sara', 'jane'];

    return (
        <>
            <input onChange={((e) => console.log(e.target.value))} type="text" placeholder="type a name" />
            <ul>
                {names.map((name) => {
                    return (
                        <p>{name}</p>
                    )
                })}
            </ul>
        </>

    )
}
